document.addEventListener('keypress', create_figure);

var par_rows = 10;
var par_cols = 6;
var length_1 = data.length;
var length_2 = data[0].length;

function create_figure(e) {
	cnt = 0;
	var tmp_data = empty_data;
	var interval = setInterval(function() {
		for (var h=0; h<par_rows; h++){
			var i = Math.floor(cnt/length_2)*par_cols;
			var j = cnt%length_2;
			for (var k=0; k<par_cols; k++){
				if ((i+k+1) > length_1){break;}
				tmp_data[i+k][j] = data[i+k][j];
			}
			cnt++
			if (cnt>length_2*(Math.floor(length_1/par_cols)+1)){
				clearInterval(interval);
				break;
			}
		}
		Plotly.restyle("plot_div", {z:[tmp_data]});
	}, 0.0001);
}
